神西清訳（39）
その顔には、冷やかな、ぴくりともしない尊大な表情が表われていたので――わたしにはまるで別人のように見え、あの眼差もあの微笑も、てんで見当らなかったけれど、それでいてこの新しい姿になっても、わたしにはやはり素晴らしいお嬢さんと思われた。着ているのは、ふわりとした薄い紗の服で、淡青い唐草模様がついていた。髪はイギリス風に、長い房をなして両の頬に垂れかかっていた。この髪かたちが、彼女の顔の冷やかな表情に、しっくり合っていた。
　父は食事の間、彼女の横に席を占しめて、もちまえの優美で落着きはらった慇懃さで、隣席の令嬢のお相手をつとめていた。父は時おり彼女の顔をちらりと眺めやる――彼女の方でも、時たま父を見返す。その彼女の顔つきが、じつに不思議な、ほとんど敵意をふくんだものだった。二人はフランス語で話し合っていたが、わたしは今でも思い出す、ジナイーダの発音の奇麗いさに、びっくりしたものである。公爵夫人は食事の間も、例によってちっとも遠慮せずに、さかんに食べては、料理を褒めそやした。

