⠀
1️⃣ нужно больше времени‼️
если мероприятие для #самопознания, то 3 часа очень мало. У нас было 3 сверхкрутых спикера, каждому из которых много было чего сказать, но в 30 минут уложиться нереально 😭поэтому в следующий раз встречаемся на целый день!!
⠀
